(window.webpackJsonp=window.webpackJsonp||[]).push([[7],{53:function(A,F,R){A.exports=R.p+"assets/img/tk10.bdb1f97e.jpg"},54:function(A,F){A.exports="data:image/jpeg;base64,"},55:function(A,F){A.exports="data:image/jpeg;base64,"},56:function(A,F){A.exports="data:image/jpeg;base64,"},57:function(A,F){A.exports="data:image/jpeg;base64,"},58:function(A,F){A.exports="data:image/jpeg;base64,"},59:function(A,F){A.exports="data:image/jpeg;base64,"},60:function(A,F){A.exports="data:image/jpeg;base64,"},61:function(A,F){A.exports="data:image/jpeg;base64,"},62:function(A,F){A.exports="data:image/jpeg;base64,"},63:function(A,F){A.exports="data:image/jpeg;base64,"},64:function(A,F){A.exports="data:image/jpeg;base64,"},65:function(A,F){A.exports="data:image/jpeg;base64,"},66:function(A,F){A.exports="data:image/jpeg;base64,"},67:function(A,F){A.exports="data:image/jpeg;base64,"},68:function(A,F){A.exports="data:image/jpeg;base64,"},69:function(A,F){A.exports="data:image/jpeg;base64,"},70:function(A,F){A.exports="data:image/jpeg;base64,"},71:function(A,F){A.exports="data:image/jpeg;base64,"},92:function(A,F,R){"use strict";R.r(F);var U=[function(){var A=this,F=A.$createElement,U=A._self._c||F;return U("div",{staticClass:"content"},[U("h1",{attrs:{id:"宇宙戰艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#宇宙戰艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 宇宙戰艦")]),U("h2",{attrs:{id:"自由行星同盟"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#自由行星同盟","aria-hidden":"true"}},[A._v("#")]),A._v(" 自由行星同盟")]),U("h3",{attrs:{id:"標準型戰艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#標準型戰艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 標準型戰艦")]),U("p",[U("img",{attrs:{src:R(71),alt:"標準型戰艦 alt <",title:"標準型戰艦"}}),A._v("\n　　負責擔任同盟軍宇宙艦隊戰鬥力中樞的，就是這種標準型戰艦。只有戰艦和高速戰艦才可以作為艦隊旗艦，旗艦一般都會另行設計製造，但本質仍是戰艦這一點並沒有改變。８門主砲，火力要凌駕於帝國軍的戰艦之上，但是在裝甲方面則稍遜一籌。其特徵是正面主砲砲塔的上下有兩塊護盾，以及安置於艦體上下的通訊天線。")]),U("p",[A._v("跟帝國戰艦不同的，同盟戰艦的推進器只有一門。帝國戰艦的推進器是使用複數的中型引擎，而同盟戰艦則使用單一的大型推進器。兵工廠的建設費較巡洋艦等為高，也較巡洋艦等重視破壞力與防禦力。無論是前、後方和側面的防禦能力都遠高於其他艦種。砲門和火力也較帝國軍戰艦多和強，巡航速度也較帝國戰艦高。但在飛彈配備、艦載艇搭載數和物資裝載量方面則比帝國少，而基準建造數量也較帝國為低，但相對於旗艦則較快，標準戰艦大約只需四至六個月便可以生產一艘，時間為一般艦隊旗艦級艦艇生產期的三分之一。")]),U("p",[A._v("不同於帝國軍，同盟軍的建軍目的並非邊境巡邏和鎮壓，而是單純的「對抗帝國軍」。故同盟軍的戰鬥艦種全都不具有於惑星停泊的能力，換句話說，也不具有登陸佔領的能力。艦隊即使回到惑星駐紮地（如伊謝爾倫的要塞則除外），仍然需要使用太空梭接駁地面和艦艇。")]),U("pre",{pre:!0,attrs:{class:"language-text"}},[U("code",[A._v("　　負責擔任同盟軍宇宙艦隊戰鬥力中樞的，就是這種標準型戰艦。\n\n　　自宇宙曆740年第一號艦進入宇宙起，至今已有五十年。經過這五十年的不斷改良和生產，據稱現今出產數目高達二十萬艘。加上建造工程進入自動化和省力化階段，據專家估計，大約只需四至六個月便可以生產一艘，時間為一般艦隊旗艦級艦艇生產期的三分之一。正好可以証明這種戰艦一直在追求更合理的設計。\n\n　　戰艦的裝備亦漸次統一。主砲由初期的荷電粒子砲改為中子光束砲，射程伸延數倍。最近與分艦隊旗艦所配置的火藥管制裝置之間結合，發展出在分旗艦指示下多艘艦艇同時向同一目標砲擊的統合砲擊系統，綜合火力因得到獨立艦艇的配合而大大充實。\n\n　　圖為標準型戰艦785年GV-H2生產型「尤里西斯」，該艦編入軍隊時隸屬第八艦隊第三十五小隊。是艘參予了多次帝國領土進攻作戰和亞姆立札星域會戰仍能生還的幸運戰艦。在亞姆立札星會域戰中受損而被指為「廁所壞掉的戰艦」。其後因第八艦隊瓦解而隨剩餘兵力重新編入以伊謝爾倫為母港的第十三艦隊，直至現在。\n")])]),U("h3",{attrs:{id:"高速戰艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#高速戰艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 高速戰艦")]),U("p",[U("img",{attrs:{src:R(70),alt:"高速戰艦 alt <",title:"高速戰艦"}}),A._v("\n　　同盟軍的高速戰艦成本較高，兵工廠的建設費也是各兵種中最高的，生產速度也遠低於標準戰艦，故較少被使用，並非宇宙艦隊戰鬥力的主要兵種。只有戰艦和高速戰艦才可以作為艦隊旗艦，旗艦一般都會另行設計製造，但本質仍是戰艦這一點並沒有改變。８門主砲，火力要凌駕於帝國軍的戰艦之上，推進器雖仍只有一個，但功率是戰艦的兩倍。")]),U("p",[A._v("跟帝國戰艦不同的，同盟戰艦的推進器只有一門。帝國戰艦的推進器是使用複數的中型引擎，而同盟戰艦則使用單一的大型推進器。同盟軍的高速戰艦速度不如帝國軍的，但火力與裝甲都較帝國軍的強。無論是前、後方和側面的防禦能力都遠高於其他艦種。火力較帝國軍戰艦強，巡航速度也較帝國戰艦高。但在設計上並沒有超出戰艦的範圍，故炮門數只跟戰艦一樣，相對便較帝國軍高速戰艦為少。飛彈配備、艦載艇搭載數和物資裝載量方面比帝國少，而基準建造數量也遠較帝國為少。")]),U("p",[A._v("不同於帝國軍，同盟軍的建軍目的並非邊境巡邏和鎮壓，而是單純的「對抗帝國軍」。故同盟軍的戰鬥艦種全都不具有於惑星停泊的能力，換句話說，也不具有登陸佔領的能力。艦隊即使回到惑星駐紮地（如伊謝爾倫的要塞則除外），仍然需要使用太空梭接駁地面和艦艇。")]),U("h3",{attrs:{id:"巡航艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#巡航艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 巡航艦")]),U("p",[U("img",{attrs:{src:R(69),alt:"巡航艦 alt <",title:"巡航艦"}}),A._v("\n　　要數同盟軍最多的艦艇，就算是這一類了。重視巡航速度的艦種，巡航速度與高速戰艦、驅逐艦同是各艦種中最高的。但是在裝甲方面略顯不足，防禦力只屬一般。巡航艦的建造工程和戰艦一樣，經過自動化後，所需時間只需兩個月，不用說，政府所以將它們計為統一規格，是考慮到新造和維修時所需成本較低之故。")]),U("p",[A._v("同盟軍巡航艦有６門主砲，破壞力稍優於帝國軍巡航艦，武備以中口徑中性光束砲為標準。艦體上下兩個部位裝有雷射氫爆飛彈的發射裝置。艦身下半部備有乘載艦艇的發射設備，最多可容納三艘斯巴達尼恩。此外艦艇外壁的硬裝甲台可以隨任務不同而選擇不同的兵器。由於艦體比高速戰艦輕，所以機動性很高，適宜於繞回、追擊等需要高速航行的作戰。")]),U("p",[A._v("與帝國巡航艦比較，前側後的防禦力都低一級，在飛彈配備、艦載艇搭載數和物資裝載量方面也比帝國為低，而破壞力和巡航速度則稍勝。基準建造數量方面也低於帝國。不同於帝國軍，同盟軍的建軍目的並非邊境巡邏和鎮壓，而是單純的「對抗帝國軍」。故同盟軍的戰鬥艦種全都不具有於惑星停泊的能力，換句話說，也不具有登陸佔領的能力。艦隊即使回到惑星駐紮地（如伊謝爾倫的要塞則除外），仍然需要使用太空梭接駁地面和艦艇。")]),U("pre",{pre:!0,attrs:{class:"language-text"}},[U("code",[A._v("　　要數同盟軍最多的艦艇，就算是這一類了。\n\n　　巡航艦的建造工程和戰艦一樣，經過自動化後，所需時間只需兩個月，不用說，政府所以將它們計為統一規格，是考慮到新造和維修時所需成本較低之故。\n\n　　武備以中口徑中性光束砲為標準。艦身下半部備有乘載艦艇的發射設備，最多可容納三艘斯巴達尼恩。此外艦艇外壁的硬裝甲台可以隨任務不同而選擇不同的兵器（圖中的艦艇並未裝備）。\n\n\n瑞達級新型巡航艦\n\n　　同盟軍最精銳的巡航艦。前方伸延部份形成的優美艦形是為了避開敵方砲擊能力而設計的。連一直以來防御營幕亦無法防守的實彈直擊也可以透過急速駛離航道而避開。有傳這設計也是因為考慮到帝國軍的新戰艦也採用類似設計，而且這設計又給人次世代艦艇的感覺而成。主砲從舊式的六門減為四門，並採用長砲身的中子光束砲，令射程、命中率、破壞力都較舊型號大大提升。此外，艦橋側面設置了荷電粒子光束砲的複合砲座，期待它與接近戰防御火藥一起發揮威力。除了機關部設置了最新型的裝備以外，亞空間穩定器的外形亦採用了較之以往更為洗練的設計。\n\n　　現在與艦型同名的同型艦艇瑞達２號己成功經過試驗，希望戰力疲憊的同盟軍可以早一日將這類型艦艇配入實戰中。\n")])]),U("h3",{attrs:{id:"驅逐艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#驅逐艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 驅逐艦")]),U("p",[U("img",{attrs:{src:R(68),alt:"驅逐艦 alt <",title:"驅逐艦"}}),A._v("\n　　同盟軍標準型驅逐艦可算是同盟軍的小形艦艇類別。同盟軍驅逐艦有6門主砲，艦體上下部位裝備雷射氫彈發射器及推進器。與巡航艦相比其推進器是橫置的（巡航艦推進器是豎置式）。驅逐艦是為了對抗敵方雷擊艇和戰鬥機而開發的，由於它是小型艦，所以裝備了用強力推進機器、速射性能良好的槍砲，和方便回轉的設計。艦隊戰的戰場即使以光秒計算，仍是廣大無邊，所以即使製作非常綿密的包圍網，把艦隊的機動能力亦計算在內，也不能保証敵方無法突破戰線。驅逐艦能迅速應付這種情況，擁有修復戰線即時應對能力，所以很有存在價值，重要性一直有增無減。")]),U("pre",{pre:!0,attrs:{class:"language-text"}},[U("code",[A._v("　　同盟軍標準型驅逐艦可算是同盟軍的小形艦艇類別。\n\n　　驅逐艦是為了對抗敵方雷擊艇和戰鬥機而開發的，由於它是小型艦，所以裝備了用強力推進機器、速射性能良好的槍砲，和方便回轉的設計。\n\n　　艦隊戰的戰場即使以光秒計算，仍是廣大無邊，所以即使製作非常綿密的包圍網，把艦隊的機動能力亦計算在內，也不能保証敵方無法突破戰線。驅逐艦能迅速應付這種情況，擁有修復戰線即時應對能力，所以很有存在價值，重要性一直有增無減。\n")])]),U("h3",{attrs:{id:"航空母艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#航空母艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 航空母艦")]),U("p",[U("img",{attrs:{src:R(67),alt:"航空母艦 alt <",title:"航空母艦"}}),A._v("\n　　全長928m，全幅241m，全高379m，龐大的艦身下部可收容多達100多艘斯巴達尼恩，在接近戰時發揮極大攻擊力。但亦是艦隊各戰鬥艦種中，巡航速度最低的。破壞力和防禦力頗佳，加上能夠搭載戰鬥艇，是艦隊不可缺少的艦種。航空母艦當進入近距離戰的時候就放出搭載的艦載機進行格鬥。同盟軍的航空母艦主砲８門，其戰力主要表現在艦載機斯巴達尼恩上。一艘標準宇宙母艦可以載８０架的單座式戰鬥艇斯巴達尼恩（10行＊８列）。艦載機直接掛在艦體中央平坦部位的下方。兵工廠建設費與艦艇生產費都是各艦種中最高的，物資消耗量也是最高。艦載機起飛時，會借助離心力從母艦拋出宇宙，然後艦載機再發動起飛。")]),U("p",[A._v("同盟軍的航空母艦史由宇宙曆750年開始，初代的航空母艦只可乘載十二艘戰機。不過，由於航空母艦所載戰機多少對收集情報有很大影響，所以同盟軍終於編組了第一隊航空母艦機動部隊。當時的宇宙艦隊司令官以六艘航空母艦組成一隊機動部隊，然後大膽向帝國軍艦隊集結地進行奇襲，戰績彪炳。而帝國軍在這時開始才警覺到空母的重要性要積極追趕開發。此後，幾近所有艦隊保護的民艦貨艦皆由航空母艦保護，後來，航空母艦擔任艦隊戰力之一已成為所有人的正確認識。當然，艦隊仍很重視提升搭載艦艇（戰鬥機）的能力問題。載艦艇能力上升成為戰場上重要且急切需要的重點。因此，各方亦力求加強塔載艦艇和戰鬥艦艇的性能。")]),U("p",[A._v("與帝國空母比較，兵工廠建設費和物資消耗量也少於帝國，前側後的防禦力都遠高於帝國，而砲門、破壞力和巡航速度也遠言於帝國艦，但在艦載艇搭載數和物資裝載量方面則比帝國為低，飛彈配備數則稍勝。")]),U("pre",{pre:!0,attrs:{class:"language-text"}},[U("code",[A._v("　　近期的艦隊戰大都已演變成以戰艦級戰艦的巨砲揭開序幕，艦隊間的距離亦佈滿友方巡航艦的中口徑砲擊，最近距離也由母艦乘載的戰機向敵人的脆弱部份施與局步性攻擊。因此，艦隊經常有載滿戰機的航空母艦伴隨在側。\n\n　　同盟軍的航空母艦史由宇宙曆750年夏天竣工的ワシントン（Washington）級開始，ワシントン級航空母艦只可乘載戰機十二架，與當代戰艦的搭載量相若。不過，由於航空母艦所載之戰機多少對收集情報有很大影響，所以同盟軍終於編組了第一隊航空母艦機動部隊。當時的宇宙艦隊司令官シヤムナ（Jamuna）大將以六艘航空母艦組成一隊機動部隊，然後大膽向帝國軍艦隊集結地進行奇襲，戰績彪炳。此後，幾近所有艦隊保護的民艦貨艦皆由航空母艦保護，後來，航空母艦擔任艦隊戰力之一已成為所有人的正確認識。當然，艦隊仍很重視提升搭載艦艇（戰鬥機）的能力問題。載艦艇能力上升成為戰場上重要且急切需要的重點。因此，各方亦力求加強塔載艦艇和戰鬥艦艇的性能。\n\n　　圖中航空母艦為ラザルス（Lazarus）級戰艦亞姆塔特。亞姆塔特竣工後即編入第十三艦隊，負責保護伊謝爾倫要塞最前線位置。它龐大的艦身下部可收容100艘斯巴達尼恩，在接近戰時發揮極大攻擊力。\n")])]),U("h3",{attrs:{id:"工作艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#工作艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 工作艦")]),U("p",[U("img",{attrs:{src:R(66),alt:"工作艦 alt <",title:"工作艦"}}),A._v("\n　　全長487m，全幅300m，全高312m，乘員64名，是負責在戰場後方修理損壞的艦艇、掃除地雷和散佈地雷等危險任務的補助艦艇，它們的存在非常重要。修護艦是負責在戰場後方修理損壞的艦艇。如果艦艇失去動力的話，甚至要衝入戰場拖帶損壞的艦艇到戰線後方。")]),U("p",[A._v("它體積巨大，速度亦非常緩慢。如果被敵軍突襲後方，這種艦根本連反抗的機會都沒有。由於亞空間跳躍能力低，所以往往跟補給艦一起編配為後援補給部隊。工作艦多收入工作艦母艦中，一併移動，但這方法用在戰場上始終不夠靈活，真正艦隊伴隨型工作艦仍在開發中。修護艦像門似的部份是通往艦體內部的工作場地，可隨任務不同而選取不同的裝備，例如裝設地雷時，多出動小型艦艇用的修理設備。")]),U("pre",{pre:!0,attrs:{class:"language-text"}},[U("code",[A._v("　　當艦隊在戰場中進進出出時，大家可別忽略了默默支持這行動的補助艦艇。\n\n　　這些工作艦默默負起掃除宙雷和散佈宙雷等危險任務，它們的存在非常重要。相片的工作艦類型是現在同盟軍主力工作艦CS02-3型，現在還繼續生產，同盟軍亦有運用其他型號的工作艦。原裝形號中像門似的部份通往艦體內部的工作場地，可隨任務不同而選取不同的裝備，例如裝設宙雷時，多出動小型艦艇用的修理設備。\n\n　　此外，原裝型號還裝置了有空間跳躍能力的機械，截至現時為止，工作艦多收入工作艦母艦中，一併移動，但這方法用在戰場上始終不夠靈活，經過改良，真正艦隊伴隨型工作艦即將誕生，期待它大展拳腳的一天。\n")])]),U("h3",{attrs:{id:"運輸艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#運輸艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 運輸艦")]),U("p",[U("img",{attrs:{src:R(65),alt:"運輸艦 alt <",title:"運輸艦"}}),A._v("\n　　運補艦是運送補艦的艦艇。輸送艦艦身可存放大量補給物資，是艘能以艦隊基本速度航行的艦隊隨伴型輸送艦，現已成為同盟軍輸送部隊的主力輸送艦。不同性質的物資亦可由內部機艙進行交換，可妥善運送液態物資、粒狀物資、一般物資等不同物資。沒有武裝，航速和機動力都極弱。所以如果被敵軍突襲後方，這種艦根本連反抗的機會都沒有。通常只跟在艦隊後方，在長期戰鬥中為前方部隊進行補給。由於亞空間跳躍能力低，所以往往跟工作艦一起編配為後援補給部隊。由於同盟軍經常處於戰略防禦的態勢，作戰也通常是在國內進行，補給線相對較短，所以在補給方面通常都有忽視的傾向。")]),U("p",[A._v("艦艇全長遠比艦隊旗艦級戰艦長，超過2500m，質量亦與長度成正比。如以此巨艦為武器，對方所受震盪約與時空震動相若，所以出動時多採用手控密集隊型，詳細情況亦有特別規定。由於大部份艦艇都在亞姆力札會戰中沈沒了，因此在同盟政權末期時補給艦亦出現短絀，因此以隕石造成球型貨櫃來運輸的情況經常出現。")]),U("pre",{pre:!0,attrs:{class:"language-text"}},[U("code",[A._v("　　艦隊出擊，燃料、彈藥當然不可少，但士兵的食物、衣物、雜物等亦不能忽略。物資輸送亦為重要戰略之一，如輕視它的重要性，一隊艦隊是沒可能凱旋而歸的。帝國領土進攻作戰之所以成為大家悲慘的回憶，正是因為物資補給計算錯誤以致大部份將兵戰死之故。\n\n　　這輸送艦艦身可存放大量補給物資，是艘能以艦隊基本速度航行的艦隊隨伴型輸送艦，現已成為同盟軍輸送部隊的主力輸送艦。\n\n　　不同性質的物資亦可由內部機艙進行交換，可妥善運送液態物資、粒狀物資、一般物資等不同物資。\n\n　　從相片判斷，艦艇全長遠比艦隊旗艦級戰艦長，超過2500m，質量亦與長度成正比。如以此巨艦為武器，對方所受震盪約與時空震動相若，所以出動時多採用手控密集隊型，詳細情況亦有特別規定。\n")])]),U("h3",{attrs:{id:"突擊登陸艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#突擊登陸艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 突擊登陸艦")]),U("p",[U("img",{attrs:{src:R(64),alt:"突擊登陸艦 alt <",title:"突擊登陸艦"}}),A._v("\n　　突擊登陸艦是同盟軍陸戰部隊的艦艇。以笨重而行動緩慢，但可以直接進出大氣層，是登陸戰及衝進敵艦進行白刃戰的必需兵種。")]),U("p",[A._v("由於同盟軍艦不同帝國軍艦，並沒有直接進出大氣層的能力，故同盟軍主力開發登陸艇的佔領能力，而其佔領效率亦遠高於帝國的登陸艇，在同盟軍有其一定的重要性。")]),U("h3",{attrs:{id:"戰鬥艇斯巴達尼恩"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#戰鬥艇斯巴達尼恩","aria-hidden":"true"}},[A._v("#")]),A._v(" 戰鬥艇斯巴達尼恩")]),U("p",[U("img",{attrs:{src:R(63),alt:"戰鬥艇斯巴達尼恩 alt <",title:"戰鬥艇斯巴達尼恩"}}),A._v("\n　　同盟軍的單座式戰鬥艇，用於近距離格鬥戰。自770年初正式採用後，便開始大量生產。全長40m，全幅7m，全高13m，機背裝備了連裝雷射機槍，機首亦裝備了四門中子光束砲。光束砲可拆下來裝上其他裝備，原本型號裝備的是實彈火藥式機槍。機師要利用一張記錄著其姓名、血型、指紋、聲音、DNA型態、軍藉號碼、階級等資料的ID卡，經電腦分析核實資料後，機師才能開動駕駛。頭盔有二道密碼與電腦直接聯繫，傳達駕駛員腦電波，如果腦波與電腦記憶中的記錄有異，頭盔會發射低輸出的高壓電擊，立即致人昏迷。機型較王爾古雷大，而且活動性較差，但火力較強，是艦隊近距離戰的必要武器。斯巴達尼恩會先收入航空母艦或戰艦的儲艦庫中，到最接近戰圈前線時出動。")]),U("h2",{attrs:{id:"銀河帝國"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#銀河帝國","aria-hidden":"true"}},[A._v("#")]),A._v(" 銀河帝國")]),U("h3",{attrs:{id:"標準型戰艦-2"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#標準型戰艦-2","aria-hidden":"true"}},[A._v("#")]),A._v(" 標準型戰艦")]),U("p",[U("img",{attrs:{src:R(62),alt:"帝國軍標準型戰艦 alt <",title:"帝國軍標準型戰艦"}}),A._v("\n　　艦隊的主力艦種，每隊艦隊大約配置二千艘。只有戰艦和高速戰艦才可以作為艦隊旗艦，旗艦一般都會另行設計製造，但本質仍是戰艦這一點並沒有改變。帝國軍標準型的戰艦，長度約677m。跟同盟戰艦不同的，帝國軍戰艦的推進器有３門。帝國戰艦的推進器是使用複數的中型引擎，而同盟戰艦則使用單一的大型推進器。原理上推進效率不及同盟戰艦，但卻可在遇上最差情況時（如引擎中彈）仍能有動力啟動，這是複式引擎的有利點。兵工廠的建設費較巡洋艦等為高，也較巡洋艦等重視破壞力與防禦力。後方和側面的防禦能力是各帝國艦種中最高的，前方防禦則略低於高速戰艦。砲門比同盟戰艦少，艦首方向主砲６門、大口徑磁力砲２門，艦側方向每邊副砲 4門，推進器前方尚有磁力砲左右各３門，而破壞力和巡航速度也較同盟戰艦低，但在飛彈配備、艦載艇搭載數和物資裝載量方面則比同盟多，而基準建造數量也較同盟為高。而由於帝國艦隊的主要任務是維護宇宙航線治安和討伐地方叛亂，因任務需要，所以帝國戰艦具有自由進出行星大氣圈的能力。")]),U("p",[A._v("帝國軍宇宙艦隊主力戰艦。一支艦隊約配備二千艘。")]),U("pre",{pre:!0,attrs:{class:"language-text"}},[U("code",[A._v("　　這類型戰艦基本上為同一規格的同型艦艇，但因應建造時期和建造工廠不同而作出少許改動。\n\n　　這類型戰艦與同盟最大不同之處是機關的構造。同盟採用一副大型機關，而帝國則是多副小型機關，效率較差，可是在中彈時所有機關可以馬上停止運作，防止最壞的情況發生。\n\n　　同盟軍整個艦隊以同一系統操控，而帝國則較關注個別艦艇性能，因此這種戰艦也可以獨立行動。同盟軍戰艦機關啟動時，由外部配給啟動能源，所以不可能作單艦行動。相反，帝國軍巡航艦以上級別的戰艦全部裝置了動力產生裝置，可以在沒有外部支援之下行動。\n\n　　此外，帝國軍艦的特微之一是艦艇有很多探測器，探測周圍環境。所以就算進入星圖不完善的邊境惑星帶，也可以避開危險宙域。\n\n　　除了以上裝備外，考慮到邊境星惑有可能發生判變，所以就算艦隊戰時，每一艦戰艦也會配備小艦隊的行動指揮官，有助艦艇靈活運用以上配備。\n")])]),U("h3",{attrs:{id:"標準高速戰艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#標準高速戰艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 標準高速戰艦")]),U("p",[U("img",{attrs:{src:R(61),alt:"帝國軍標準高速戰艦 alt <",title:"帝國軍標準高速戰艦"}}),A._v("\n　　同是艦隊的主力艦種，重視巡航速度，以勇猛著名的「黑色槍騎兵」便是以高速戰艦為艦隊的構成核心。艦體細長，較標準戰艦強化了引擎部份，加速力和極速均有所提升。只有戰艦和高速戰艦才可以作為艦隊旗艦，米達麥亞和畢典菲爾特的旗艦便是高速戰艦。兵工廠的建設費較巡航艦等為高，也較巡航艦等重視破壞力與防禦力。")]),U("p",[A._v("由於比標準戰艦較重視巡航速度，故前方的防禦雖高於標準戰艦，但後方和側面的防禦能力比標準戰艦略遜一籌，但這仍然是各帝國艦種中第二高的。砲門遠多於標準戰艦，有６門主砲及５個推進器噴口，其中四個呈「Ｘ」字型，另一個位於Ｘ型的正上方。破壞力也較標準戰艦為高，但生產數量、生產時間卻較標準戰艦低和久，而且建造費也較高。速度快、火力強，但裝甲稍嫌薄弱，是帝國軍為了彌補戰艦的行動緩慢與巡航艦火力不足，而開發出來的艦種。")]),U("p",[A._v("與同盟高速戰艦比較，前側後的防禦也較高，在飛彈配備、艦載艇搭載數和物資裝載量方面也比同盟多，而破壞力和巡航速度則較同盟艦為低。基準建造數量方面，帝國高速戰艦的生產數量雖較標準戰艦為低，但仍遠多於同盟。而由於帝國艦隊的主要任務是維護宇宙航線治安和討伐地方叛亂，因任務需要，故高速戰艦也與戰艦同具有自由進出行星大氣圈的能力。")]),U("pre",{pre:!0,attrs:{class:"language-text"}},[U("code",[A._v("　　能夠在有大氣層的惑星降落及起飛，是帝國軍艦的特徵之一。所以戰艦都裝置了重力控制裝置。除此以外，為了向領地人民示威，航艦有時亦有需要在地面降落。\n\n　　這種帝國標準型高速戰艦強化了標準型戰艦的機關部份，加強了正常空間的加速能力和最快到達速度。以勇猛見稱的黑色槍騎兵艦隊大部份都是這類戰艦。\n\n　　速度雖高，但是回轉卻是它的缺點。由於這類型艦隊經常以「第一突襲隊型」出戰，所以回轉時需要約數光秒的空間，因此讓人有「匹夫之勇」的感覺。\n\n　　現在所知，這類戰艦間加速能力特強，此外也有目擊者指它是亞空間航行時間最快的戰艦，有待証實。\n\n　　這種戰艦身型細長但內置大型機關，深受戰艦愛好者歡迎。\n")])]),U("h3",{attrs:{id:"標準巡航艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#標準巡航艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 標準巡航艦")]),U("p",[U("img",{attrs:{src:R(60),alt:"帝國軍標準巡航艦 alt <",title:"帝國軍標準巡航艦"}}),A._v("\n　　重視巡航速度的艦種，巡航速度與高速戰艦、驅逐艦同是各艦種中最高的。帝國軍巡航艦較重視破壞力，強化了航速及火力，但是在裝甲方面略顯不足，防禦力只屬一般。重視巡航速度，在防禦能力方面略遜戰艦一籌。主砲６門，推進器與高速戰艦一樣，不過推進的力量要弱一個等級。由於艦體比高速戰艦輕，所以機動性很高，適宜於繞回、追擊等需要高速航行的作戰。")]),U("p",[A._v("與同盟巡航艦比較，前側後的防禦力都較高，在飛彈配備、艦載艇搭載數和物資裝載量方面也比同盟為高，而破壞力和巡航速度則較同盟艦為低。基準建造數量方面多於同盟。而由於帝國艦隊的主要任務是維護宇宙航線治安和討伐地方叛亂，因任務需要，故巡航艦也與戰艦同具有自由進出行星大氣圈的能力。")]),U("pre",{pre:!0,attrs:{class:"language-text"}},[U("code",[A._v("　　這種兼備長距離航行與高機動力的戰艦，在帝國軍進行宇宙艦隊戰時廣受重用。一般而言，艦隊決戰時戰艦主砲齊射，擊潰敵方防禦陣型，這時巡航艦就進行突襲。雖然防御力不高，但是機動力良好，當以最高速迴避機動能力啟動時，很難成功瞄準擊落它。\n\n　　這類戰艦基本上以三至四艘為一小集團行動，而大集團大約有十艘。分艦隊旗艦以戰艦級艦艇為多，但是也有些是以同型的巡航艦為旗艦。亞姆立札星域會戰中遭遇第十二艦隊的帝國艦隊就是一隊以巡航艦為中心，全部艦身塗上赤色的紅色，約由一百艘艦艇組成。\n\n　　裝備方面，這類艦艇艦首裝備有中口徑中子光束砲，而艦體各都裝備了發射口，也配備了對付小艦時用的雷射機槍座。\n")])]),U("h3",{attrs:{id:"標準驅逐艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#標準驅逐艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 標準驅逐艦")]),U("p",[U("img",{attrs:{src:R(59),alt:"帝國軍標準驅逐艦 alt <",title:"帝國軍標準驅逐艦"}}),A._v("\n　　也是重視巡航速度的艦種，巡航速度與高速戰艦和巡航艦同是各艦種中最高的。由於要打遊擊機動戰，因此較重視機動性，破壞力和防禦力只屬一般，但物資消耗量是各戰鬥艦種中最低的。帝國軍的驅逐艦外型非常容易辯認，首先是高聳於艦首的斜楔狀指揮塔，方型的正面上有著眾多的主砲射孔，以及艦體後方上下兩個疊放的推進器。該艦型主砲數量雖多，但是卻都是近程砲，再加上大量的飛彈發射裝置，極適宜於近距離格鬥戰。兵工廠建設費與艦艇生產費都非常低，是屬於大量生產，重視數量輕於質素的艦種。與宙雷艦、王爾古雷一起，組成了帝國軍近距離格鬥戰的主力。")]),U("p",[A._v("與同盟驅逐艦比較，破壞力、巡航速度和前側後的防禦力都較低，在飛彈配備和物資裝載量方面也比同盟為少，但帝國軍驅逐艦卻可搭載戰鬥艇，稍為補足了各方面的不足。而帝國軍驅逐艦是帝國艦隊各戰鬥艦種中，與航空母艦同是不具有自由進出行星大氣圈的能力的艦種。")]),U("h3",{attrs:{id:"標準航空母艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#標準航空母艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 標準航空母艦")]),U("p",[U("img",{attrs:{src:R(58),alt:"帝國軍標準航空母艦 alt <",title:"帝國軍標準航空母艦"}}),A._v("\n　　是帝國艦隊各戰鬥艦種中，巡航速度最低的，也是最遲被開發的艦種。破壞力和防禦力頗佳，加上能夠搭載戰鬥艇，是艦隊不可缺少的艦種。兵工廠建設費與艦艇生產費都是各艦種中最高的，物資消耗量也是最高。航空母艦當進入近距離戰的時候就放出搭載的艦載機進行格鬥。艦體背部一直伸延到推進器的部位有兩個巨大的背峰，那是艦載機王爾古雷整備區。艦載機起飛時，會借助離心力從母艦拋出宇宙，然後艦載機再發動起飛。")]),U("p",[A._v("帝國軍的空母是最遲被開發的艦種。同盟軍在宇宙曆750年開發航空母艦後，其航空母艦機動部隊多次對帝國軍進行奇襲，戰績彪炳。而帝國軍在這時開始才警覺到空母的重要性要積極追趕開發。爾後航空母艦擔任艦隊戰力之一已成為所有人的正確認識，而載艦艇能力上升亦成為了戰場上重要且急切需要的重點。")]),U("p",[A._v("與同盟空母比較，兵工廠建設費和物資消耗量也多於同盟，前側後的防禦力都遠低於同盟，而砲門、破壞力和巡航速度也遠低於同盟艦，但在艦載艇搭載數和物資裝載量方面則比同盟為高，飛彈配備數則稍遜。而帝國空母是帝國艦隊各戰鬥艦種中，與驅逐艦同是不具有自由進出行星大氣圈的能力的艦種。")]),U("h3",{attrs:{id:"工作艦-2"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#工作艦-2","aria-hidden":"true"}},[A._v("#")]),A._v(" 工作艦")]),U("p",[U("img",{attrs:{src:R(57),alt:"帝國軍工作艦 alt <",title:"帝國軍工作艦"}}),A._v("\n　　帝國艦隊的任務性質，其中包括了巡邏和鎮壓的工作，需要在邊境地區長期工作。由於不能經常回駐紮地維修，因此修護艦是不可欠缺的補助後援兵種。修護艦除負責日常的維修作業，還包括損傷艦的補修、改修，所以其工場設備達到惑星修復船塢的水平，對細微的調校維修技術相當得意。由於工作艦也負責掃除機雷的工作，因此艦艇的操縱必須非常謹慎。")]),U("p",[A._v("修護艦是負責在戰場後方修理損壞的艦艇。如果艦艇失去動力的話，甚至要衝入戰場拖帶損壞的艦艇到戰線後方。它艦體呈「Ｈ」型，體積巨大，沒有武裝，速度亦非常緩慢，航速和機動力都極弱。所以如果被敵軍突襲後方，這種艦根本連反抗的機會都沒有。由於亞空間跳躍能力低，所以往往跟補給艦一起編配為後援補給部隊。")]),U("pre",{pre:!0,attrs:{class:"language-text"}},[U("code",[A._v("　　帝國軍因為任務性質不同，故有很多邊境惑星的長期艦隊行動。這種情況下，工作艦就成了補助艦艇群中不可或缺的戰艦。\n\n　　這種艦艇有工場設備，負責日常看守工作、修補及改裝受損傷的艦艇等，這些工場可以說是更勝惑星上的工廠，而且最擅長控制低出力機關的加減速，適合需要謹慎艦艇操作的掃除地雷行動。\n\n　　公開資料表示，Ｈ型戰艦可以兩艘同時進行看守行動，可是由於工廠能力有限，所以未有實際試過兩艘工作艦結合的情況。\n\n　　由於工作艦的亞空間跳躍能力低，所以多數跟隨以輸送艦為中心的補給艦隊行動。\n")])]),U("h3",{attrs:{id:"運輸艦-2"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#運輸艦-2","aria-hidden":"true"}},[A._v("#")]),A._v(" 運輸艦")]),U("p",[U("img",{attrs:{src:R(56),alt:"帝國軍運輸艦 alt <",title:"帝國軍運輸艦"}}),A._v("\n　　運補艦是運送補艦的艦艇。沒有武裝，航速和機動力都極弱。所以如果被敵軍突襲後方，這種艦根本連反抗的機會都沒有。")]),U("p",[A._v("通常只跟在艦隊後方，在長期戰鬥中為前方部隊進行補給。由於亞空間跳躍能力低，所以往往跟工作艦一起編配為後援補給部隊。")]),U("h3",{attrs:{id:"帝國軍突擊登陸艦"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#帝國軍突擊登陸艦","aria-hidden":"true"}},[A._v("#")]),A._v(" 帝國軍突擊登陸艦")]),U("p",[U("img",{attrs:{src:R(55),alt:"帝國軍突擊登陸艦 alt <",title:"帝國軍突擊登陸艦"}}),A._v("\n　　突擊登陸艦是帝國軍裝甲擲彈兵的艦艇。以笨重而行動緩慢，但可以直接進出大氣層，是登陸戰及衝進敵艦進行白刃戰的必需兵種。")]),U("p",[A._v("但因帝國軍艦具有直接進出大氣層的能力，加上佔領效率低遜於同盟的登陸艇，故其重要性在帝國軍中不及同盟的登陸艇。")]),U("h3",{attrs:{id:"戰鬥艇王爾古雷"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#戰鬥艇王爾古雷","aria-hidden":"true"}},[A._v("#")]),A._v(" 戰鬥艇王爾古雷")]),U("p",[U("img",{attrs:{src:R(54),alt:"帝國軍戰鬥艇王爾古雷 alt <",title:"帝國軍戰鬥艇王爾古雷"}}),A._v("\n　　王爾古雷是帝國軍用於近距離格鬥戰的Ｘ型機翼單座式戰鬥艇。王爾古雷會先收入航空母艦或戰艦的儲艦庫中，到最接近戰圈前線時出動。機動能力高，對手是同盟軍的「斯巴達尼恩」。裝有４門光束砲，及４個分佈呈十字型的推進器。推進器與機體之間可以旋轉，即機體指向的方向可與前進的方向呈直角，這種形態通常用於攻擊艦艇時。名字出於北歐神話，以北歐神話中的女武神．Walkure 命名。王爾古雷機型小巧，火力較同盟軍的斯巴達尼恩差，但活動性強，最適合作近距離肉搏戰。")]),U("pre",{pre:!0,attrs:{class:"language-text"}},[U("code",[A._v("　　帝國軍標準單座戰鬥機。通常停註在艦艇停機庫，當艦隊進行近距離戰時才出動。\n\n　　公開資料表示王爾古雷的機關運用化學燃料，但這不過是欺騙敵軍之用。因為根據現實情況，王爾古雷絕對不會使用古老的化學燃料為能源。\n\n　　根據推進氣體的噴射速度分析，王爾古雷似乎是使用２ＭＷ級的小型核機關推進濟，情況類似以水推進一樣。\n\n　　主要武備是四台雷射砲，分別裝在艦身兩則向外申延的腕狀設計中，這腕狀設計可以使艦艇作上下三百六十度，左右三百六十度全方位旋轉，以便追蹤敵艦。\n　　此外，變型時雷射砲可以與軌道砲交換。\n")])]),U("h3",{attrs:{id:"雷擊艇"}},[U("a",{staticClass:"header-anchor",attrs:{href:"#雷擊艇","aria-hidden":"true"}},[A._v("#")]),A._v(" 雷擊艇")]),U("p",[U("img",{attrs:{src:R(53),alt:"帝國軍雷擊艇 alt <",title:"帝國軍雷擊艇"}})]),U("p",[A._v("全長六米的小型艦艇。是一種裝置有二十四台軌道砲的強力武裝艦。")]),U("p",[A._v("裝置有高機動性推進器，所以有高機動能力。由於沒有亞空間跳躍能力，所以要亞空間跳躍時就要返回母艦，換句話說，雷擊艦母艦成為艦隊必備的艦種之一。")]),U("p",[A._v("可是由於沒有裝備特效防御壁，所以防彈能力薄弱。")]),U("p",[A._v("如果與王爾古雷配合作戰的話，卻可以變化出多種戰陣，與王古雷一起，在敵艦受到多角度攻擊之際，衝進對方防御網，在最近距離給與對方致命一擊，然後速離開。這種戰法曾擊沈多艘同盟戰艦，因此，同盟軍此後加強了雷射光束槍應戰。")]),U("p",[U("strong",[A._v("黑底方塊補充資料來自《銀英傳 Data Book．機械與聲優大事典》。小poon翻譯")])])])}],P=R(0),f=Object(P.a)({},function(){this.$createElement;this._self._c;return this._m(0)},U,!1,null,null,null);F.default=f.exports}}]);